INSERT INTO `wp_postmeta` VALUES (109,3,'_wp_suggested_privacy_policy_content','a:3:{s:11:\"plugin_name\";s:9:\"WordPress\";s:11:\"policy_text\";s:5136:\"<h2>Qui sommes-nous¬†?</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>L‚Äôadresse de notre site est¬†: http://dragan-concept.local.</p><h2>Commentaires</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Quand vous laissez un commentaire sur notre site, les donn√©es inscrites dans le formulaire de commentaire, ainsi que votre adresse IP et l‚Äôagent utilisateur de votre navigateur sont collect√©s pour nous aider √† la d√©tection des commentaires ind√©sirables.</p><p>Une cha√Æne anonymis√©e cr√©√©e √† partir de votre adresse e-mail (√©galement appel√©e hash) peut √™tre envoy√©e au service Gravatar pour v√©rifier si vous utilisez ce dernier. Les clauses de confidentialit√© du service Gravatar sont disponibles ici¬†: https://automattic.com/privacy/. Apr√®s validation de votre commentaire, votre photo de profil sera visible publiquement √† cot√© de votre commentaire.</p><h2>M√©dias</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Si vous t√©l√©versez des images sur le site, nous vous conseillons d‚Äô√©viter de t√©l√©verser des images contenant des donn√©es EXIF de coordonn√©es GPS. Les personnes visitant votre site peuvent t√©l√©charger et extraire des donn√©es de localisation depuis ces images.</p><h2>Cookies</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Si vous d√©posez un commentaire sur notre site, il vous sera propos√© d‚Äôenregistrer votre nom, adresse e-mail et site dans des cookies. C‚Äôest uniquement pour votre confort afin de ne pas avoir √† saisir ces informations si vous d√©posez un autre commentaire plus tard. Ces cookies expirent au bout d‚Äôun an.</p><p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera cr√©√© afin de d√©terminer si votre navigateur accepte les cookies. Il ne contient pas de donn√©es personnelles et sera supprim√© automatiquement √† la fermeture de votre navigateur.</p><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos pr√©f√©rences d‚Äô√©cran. La dur√©e de vie d‚Äôun cookie de connexion est de deux jours, celle d‚Äôun cookie d‚Äôoption d‚Äô√©cran est d‚Äôun an. Si vous cochez ¬´¬†Se souvenir de moi¬†¬ª, votre cookie de connexion sera conserv√© pendant deux semaines. Si vous vous d√©connectez de votre compte, le cookie de connexion sera effac√©.</p><p>En modifiant ou en publiant une publication, un cookie suppl√©mentaire sera enregistr√© dans votre navigateur. Ce cookie ne comprend aucune donn√©e personnelle. Il indique simplement l‚ÄôID de la publication que vous venez de modifier. Il expire au bout d‚Äôun jour.</p><h2>Contenu embarqu√© depuis d‚Äôautres sites</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Les articles de ce site peuvent inclure des contenus int√©gr√©s (par exemple des vid√©os, images, articles‚Ä¶). Le contenu int√©gr√© depuis d‚Äôautres sites se comporte de la m√™me mani√®re que si le visiteur se rendait sur cet autre site.</p><p>Ces sites web pourraient collecter des donn√©es sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqu√©s si vous disposez d‚Äôun compte connect√© sur leur site web.</p><h2>Utilisation et transmission de vos donn√©es personnelles</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Si vous demandez une r√©initialisation de votre mot de passe, votre adresse IP sera incluse dans l‚Äôe-mail de r√©initialisation.</p><h2>Dur√©es de stockage de vos donn√©es</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Si vous laissez un commentaire, le commentaire et ses m√©tadonn√©es sont conserv√©s ind√©finiment. Cela permet de reconna√Ætre et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de mod√©ration.</p><p>Pour les comptes qui s‚Äôinscrivent sur notre site (le cas √©ch√©ant), nous stockons √©galement les donn√©es personnelles indiqu√©es dans leur profil. Tous les comptes peuvent voir, modifier ou supprimer leurs informations personnelles √† tout moment (√† l‚Äôexception de leur identifiant). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><h2>Les droits que vous avez sur vos donn√©es</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Si vous avez un compte ou si vous avez laiss√© des commentaires sur le site, vous pouvez demander √† recevoir un fichier contenant toutes les donn√©es personnelles que nous poss√©dons √† votre sujet, incluant celles que vous nous avez fournies. Vous pouvez √©galement demander la suppression des donn√©es personnelles vous concernant. Cela ne prend pas en compte les donn√©es stock√©es √† des fins administratives, l√©gales ou pour des raisons de s√©curit√©.</p><h2>O√π vos donn√©es sont envoy√©es</h2><p><strong class=\"privacy-policy-tutorial\">Texte sugg√©r√©¬†: </strong>Les commentaires des visiteurs peuvent √™tre v√©rifi√©s √† l‚Äôaide d‚Äôun service automatis√© de d√©tection des commentaires ind√©sirables.</p>\";s:5:\"added\";i:1692465666;}');
