INSERT INTO `wp_posts` VALUES (2,1,'2023-08-17 15:49:17','2023-08-17 15:49:17','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://dragan-concept.local/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2023-08-17 15:49:17','2023-08-17 15:49:17','',0,'http://dragan-concept.local/?page_id=2',0,'page','',0);
INSERT INTO `wp_posts` VALUES (3,1,'2023-08-17 15:49:17','2023-08-17 13:49:17','<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Qui sommes-nous&nbsp;?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>L‚Äôadresse de notre site est&nbsp;: http://dragan-concept.local.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Commentaires</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Quand vous laissez un commentaire sur notre site, les donn√©es inscrites dans le formulaire de commentaire, ainsi que votre adresse IP et l‚Äôagent utilisateur de votre navigateur sont collect√©s pour nous aider √† la d√©tection des commentaires ind√©sirables.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une cha√Æne anonymis√©e cr√©√©e √† partir de votre adresse e-mail (√©galement appel√©e hash) peut √™tre envoy√©e au service Gravatar pour v√©rifier si vous utilisez ce dernier. Les clauses de confidentialit√© du service Gravatar sont disponibles ici&nbsp;: https://automattic.com/privacy/. Apr√®s validation de votre commentaire, votre photo de profil sera visible publiquement √† cot√© de votre commentaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">M√©dias</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous t√©l√©versez des images sur le site, nous vous conseillons d‚Äô√©viter de t√©l√©verser des images contenant des donn√©es EXIF de coordonn√©es GPS. Les personnes visitant votre site peuvent t√©l√©charger et extraire des donn√©es de localisation depuis ces images.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Cookies</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous d√©posez un commentaire sur notre site, il vous sera propos√© d‚Äôenregistrer votre nom, adresse e-mail et site dans des cookies. C‚Äôest uniquement pour votre confort afin de ne pas avoir √† saisir ces informations si vous d√©posez un autre commentaire plus tard. Ces cookies expirent au bout d‚Äôun an.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera cr√©√© afin de d√©terminer si votre navigateur accepte les cookies. Il ne contient pas de donn√©es personnelles et sera supprim√© automatiquement √† la fermeture de votre navigateur.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos pr√©f√©rences d‚Äô√©cran. La dur√©e de vie d‚Äôun cookie de connexion est de deux jours, celle d‚Äôun cookie d‚Äôoption d‚Äô√©cran est d‚Äôun an. Si vous cochez ¬´&nbsp;Se souvenir de moi&nbsp;¬ª, votre cookie de connexion sera conserv√© pendant deux semaines. Si vous vous d√©connectez de votre compte, le cookie de connexion sera effac√©.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En modifiant ou en publiant une publication, un cookie suppl√©mentaire sera enregistr√© dans votre navigateur. Ce cookie ne comprend aucune donn√©e personnelle. Il indique simplement l‚ÄôID de la publication que vous venez de modifier. Il expire au bout d‚Äôun jour.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Contenu embarqu√© depuis d‚Äôautres sites</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Les articles de ce site peuvent inclure des contenus int√©gr√©s (par exemple des vid√©os, images, articles‚Ä¶). Le contenu int√©gr√© depuis d‚Äôautres sites se comporte de la m√™me mani√®re que si le visiteur se rendait sur cet autre site.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ces sites web pourraient collecter des donn√©es sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqu√©s si vous disposez d‚Äôun compte connect√© sur leur site web.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Utilisation et transmission de vos donn√©es personnelles</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous demandez une r√©initialisation de votre mot de passe, votre adresse IP sera incluse dans l‚Äôe-mail de r√©initialisation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Dur√©es de stockage de vos donn√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous laissez un commentaire, le commentaire et ses m√©tadonn√©es sont conserv√©s ind√©finiment. Cela permet de reconna√Ætre et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de mod√©ration.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour les comptes qui s‚Äôinscrivent sur notre site (le cas √©ch√©ant), nous stockons √©galement les donn√©es personnelles indiqu√©es dans leur profil. Tous les comptes peuvent voir, modifier ou supprimer leurs informations personnelles √† tout moment (√† l‚Äôexception de leur identifiant). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Les droits que vous avez sur vos donn√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous avez un compte ou si vous avez laiss√© des commentaires sur le site, vous pouvez demander √† recevoir un fichier contenant toutes les donn√©es personnelles que nous poss√©dons √† votre sujet, incluant celles que vous nous avez fournies. Vous pouvez √©galement demander la suppression des donn√©es personnelles vous concernant. Cela ne prend pas en compte les donn√©es stock√©es √† des fins administratives, l√©gales ou pour des raisons de s√©curit√©.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">O√π vos donn√©es sont envoy√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Les commentaires des visiteurs peuvent √™tre v√©rifi√©s √† l‚Äôaide d‚Äôun service automatis√© de d√©tection des commentaires ind√©sirables.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"black\"} -->\n<p class=\"has-black-color has-text-color\"></p>\n<!-- /wp:paragraph -->','Mentions l√©gales','','publish','closed','closed','','privacy-policy','','','2023-08-19 19:42:25','2023-08-19 17:42:25','',0,'http://dragan-concept.local/?page_id=3',0,'page','',0);
