ilisation et transmission de vos donn√©es personnelles</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous demandez une r√©initialisation de votre mot de passe, votre adresse IP sera incluse dans l‚Äôe-mail de r√©initialisation.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Dur√©es de stockage de vos donn√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous laissez un commentaire, le commentaire et ses m√©tadonn√©es sont conserv√©s ind√©finiment. Cela permet de reconna√Ætre et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de mod√©ration.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour les comptes qui s‚Äôinscrivent sur notre site (le cas √©ch√©ant), nous stockons √©galement les donn√©es personnelles indiqu√©es dans leur profil. Tous les comptes peuvent voir, modifier ou supprimer leurs informations personnelles √† tout moment (√† l‚Äôexception de leur identifiant). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Les droits que vous avez sur vos donn√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si vous avez un compte ou si vous avez laiss√© des commentaires sur le site, vous pouvez demander √† recevoir un fichier contenant toutes les donn√©es personnelles que nous poss√©dons √† votre sujet, incluant celles que vous nous avez fournies. Vous pouvez √©galement demander la suppression des donn√©es personnelles vous concernant. Cela ne prend pas en compte les donn√©es stock√©es √† des fins administratives, l√©gales ou pour des raisons de s√©curit√©.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">O√π vos donn√©es sont envoy√©es</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Les commentaires des visiteurs peuvent √™tre v√©rifi√©s √† l‚Äôaide d‚Äôun service automatis√© de d√©tection des com